import "./HomePage.css";

function CornerPiece(props) {
  return <div>{props.value}</div>;
}

const HomePage = () => {
  return (
    <div id="menu-outer">
      <div class="alignleft">
        <CornerPiece value={<h2>ThisIsMyLogo</h2>} />
      </div>
      <div id="navcontainer">
        <ul>
          <li>
            <a href="#">Milk</a>
          </li>
          <li>
            <a href="#">Eggs</a>
          </li>
          <li>
            <a href="#">Cheese</a>
          </li>
        </ul>
      </div>
      <div class="alignright">
        <CornerPiece value={<h3>Profile</h3>} />
      </div>
    </div>
  );
};

export default HomePage;
